要将字符串转换为整数，您可以使用内置的Val函数：
Dim s As String
Dim i As Integer
s = "123"
i = Val(s)

' i now is 123

但是，如果字符串不是有效的数字，则Val将返回它能够转换的数字，直到第一个非数字字符。 例如，如果s 是 "123abc"，Val 将返回 123。如果字符串不以数字开头，Val 将返回 0。如果您需要不同的行为，您可能需要改用不同的函数，例如CDbl。

要将整数转换为字符串，只需使用CStr：
Dim i As Integer
Dim s As String
i = 123
s = CStr(i)
' s now is "123"

或者，您可以使用隐式转换：
Dim i As Integer
Dim s As String
i = 123
s = i
' s now is "123"

相反，您还可以将字符串隐式转换为数字：
Dim s As String
Dim i As Integer
s = "123"
i = s
' i now is 123

但是，如果字符串不是有效的数字，这将在运行时引发错误，因此您可能需要首先使用IsNumeric 进行检查。

To convert a string to an integer, you can use the built-inVal function:
Dim s As String
Dim i As Integer
s = "123"
i = Val(s)

' i now is 123

However,Val will return the numbers it can convert until it hits a non-numeric character. For example, if s is "123abc", Val will return 123. If the string doesn't begin with numbers, Val will return 0. If you need different behavior, you might want to use a different function, like CDbl.

To convert an integer to a string, just useCStr:
Dim i As Integer
Dim s As String
i = 123
s = CStr(i)
' s now is "123"

Alternatively, you can use implicit conversion:
Dim i As Integer
Dim s As String
i = 123
s = i
' s now is "123"

Conversely, you can also convert a string to a number implicitly:
Dim s As String
Dim i As Integer
s = "123"
i = s
' i now is 123

However, this will throw a runtime error if the string is not a valid number, so you might want to check it first withIsNumeric.

